class Slides extends Component {

  getImages() {
    const { images } = this.props;
    console.log('props', this.props);
    if(images && images > 0) {
      images.forEach((item) => {
        console.log('ITEM', item)
        return (  
          <div className="slide">
            <img alt='' src={require(item)} />
          </div>
        )
      })
    }
  }

  render () {
    return (
      <div className="slides">{this.getImages()}</div>
    );
  }
}

export default Slides;
